0cm .0001pt 40px;mso-add-space:auto;text-indent:-14.2pt;\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;font-size:12.0pt;\"><span style=\"line-height:150%;\" dir=\"ltr\" lang=\"IN\">c. melaksanakan layanan penyelesaian seng</span><span style=\"line-height:150%;mso-ansi-language:EN-US;\">k</span><span style=\"line-height:150%;\" dir=\"ltr\" lang=\"IN\">eta kontrak melalui mediasi;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin:0cm 0cm .0001pt 40px;mso-add-space:auto;text-indent:-14.2pt;\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;font-size:12.0pt;\"><span style=\"line-height:150%;\" dir=\"ltr\" lang=\"IN\">d. melaksanakan layanan pendampingan hukurn terhadap pelaku pengadaan barang/jasa; dan&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%;margin:0cm 0cm .0001pt 40px;mso-add-space:auto;text-indent:-14.2pt;\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;font-size:12.0pt;\"><span style=\"line-height:150%;\" dir=\"ltr\" lang=\"IN\">e. melaksanakan tugas kedinasan lainnya yang diberikan oleh pimpinan.</span></span><o:p></o:p></p></td></tr></tbody></table></figure><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%;margin:0cm 0cm .0001pt 42.55pt;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><o:p></o:p></p>', 7, '2023-03-20 17:00:00', '2023-03-26 10:56:01'),
