(10, 'Tupoksi : Kepala Biro', 'kepala-biro', '<figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:3.52%;\"><col style=\"width:96.48%;\"></colgroup><tbody><tr><td colspan=\"2\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\"><strong>Bagian Pengelolaan Pengadaan Barang/Jasa, membawahi 3 (tiga) Subbagian, yaitu :&nbsp;</strong></span></span></td></tr><tr><td><p style=\"text-align:center;\">1</p></td><td><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">Subbagian Pengelolaan Strategi Pengadaan Barang/ Jasa;&nbsp;</span></span></td></tr><tr><td><p style=\"text-align:center;\">&nbsp;</p></td><td><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">a. melaksanakan inventarisasi paket pengadaan barang/ jasa;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">b. melaksanakan riset dan analisis pasar barang/jasa;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">c. melaksanakan penyusunan strategi pengadaan barang/ jasa;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">d. menyusun kebijakan dan standar prosedur pengadaan barang/ jasa; dan&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">e. melaksanakan tugas kedinasan lainnya yang diberikan oleh pimpinan.</span></span></p></td></tr><tr><td><p style=\"text-align:center;\">2</p></td><td><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">Subbagian Pelaksanaan Pengadaan Barang/Jasa;&nbsp;</span></span></td></tr><tr><td><p style=\"text-align:center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p></td><td><p class=\"MsoNormal\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;tab-stops:1.0cm 49.65pt;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;mso-ansi-language:EN-US;\" times=\"\" new=\"\">&nbsp; a.&nbsp;</span><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">menyiapkan dan mengelola dokurnen pemilihan beserta dokumen pendukung lainnya dan</span><span style=\"line-height:150%;mso-ansi-language:EN-US;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp;</span><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">informasi yang dibutuhkan;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;tab-stops:1.0cm 49.65pt;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; b. melaksanakan pemilihan penyedia barang/ jasa;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;tab-stops:1.0cm 49.65pt;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; c. menyusun dan mengelola katalog elektronik lokal/ sektoral;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;tab-stops:1.0cm 49.65pt;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;mso-ansi-language:EN-US;\" times=\"\" new=\"\">&nbsp; d.&nbsp;</span><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">membantu perencanaan dan pengelolaan kontrak pengadaan barang/jasa pemerintah; dan&nbsp;</span></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;tab-stops:1.0cm 49.65pt;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; e. melaksanakan tugas kedinasan lainnya yang diberikan oleh pimpinan.</span></span></p></td></tr><tr><td><p style=\"text-align:center;\">3</p></td><td><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">Subbagian Pemantauan dan Evaluasi PengadaanBarang/ Jasa.</span></span></td></tr><tr><td><p style=\"text-align:center;\">&nbsp;</p></td><td><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; a. melaksanakan pemantauan pelaksanaan pengadaan barang/jasa pemerintah;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; b. melaksanakan evaluasi pelaksanaan pengadaan barang/jasa pemerintah;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; c. memberikan masukan basil pemantauan dan evaluasi sebagai bahan penyusunan strategi pengadaan barang/ jasa;&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; d. menyusun laporan dan tindak lanjut basil pemantauan serta evaluasi pelaksanaan pengadaan barang/ jasa; dan&nbsp;</span></span><o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%;margin-bottom:.0001pt;margin-right:0cm;margin-top:0cm;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><span style=\"font-family:;\"><span style=\"line-height:150%;\" dir=\"ltr\" times=\"\" new=\"\" lang=\"IN\">&nbsp; e. melaksanakan tugas kedinasan lainnya yang diberikan oleh pimpinan.</span></span></p></td></tr></tbody></table></figure><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%;margin:0cm 0cm .0001pt 42.55pt;mso-add-space:auto;tab-stops:1.0cm;text-indent:-7.1pt;\"><o:p></o:p></p>', 4, '2023-03-20 17:00:00', '2023-03-26 10:42:19');

