(18, '1 KUNJUNGAN KERJA DPRD KABUPATEN BANGKA SELATAN TERKAIT PENYESUAIAN APBD TA. 2023 PADA BADAN PENGELOLA KEUANGAN DAN ASET DAERAH PROVINSI SUMATERA SELATAN', '1-kunjungan-kerja-dprd-kabupaten-bangka-selatan-terkait-penyesuaian-apbd-ta-2023-pada-badan-pengelola-keuangan-dan-aset-daerah-provinsi-sumatera-selatan', '230326115421.jpg', '<div class=\"entry-content\"><p>Pada hari Senin, 20 Februari 2023 DPRD&nbsp; Kabupaten Bangka Selatan melakukan kunjungan kerja di Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan terkait “ Penyesuaian terhadap PMK&nbsp; No. 212/PMK.07/2022 tahun 2022 tentang Indikator Tingkat Kinerja Daerah dan Ketentuan Umum Bagian Dana Alokasi Umum yang ditentukan Penggunaanya pada APBD Tahun Anggaran 2023.</p><p>Kegiatan Kunjungan Kerja Tim DPRD Kabupaten Bangka Selatan dipimpin oleh Bapak&nbsp; Abu Huairi, SE diterima langsung oleh Bapak H. Akhmad Mukhlis, SE, M.Si selaku Kepala BPKAD Prov. Sumsel yang didampingi oleh Bapak Bobby Novian, SE. M.Si selaku Kepala Bidang Anggaran Pada BPKAD Prov. Sumsel.</p><p><img class=\"wp-image-3108 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1.jpg 566w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1-400x300.jpg 400w\" sizes=\"(max-width: 769px) 100vw, 769px\" width=\"769\" height=\"576\"></p><p>Ada beberapa permasalahan yang dipertanyakan oleh Tim Banggar DPRD Kabupaten Bangka Selatan yang direspon oleh Kepala BPKAD Prov. Sumsel antara lain yaitu mengenai apabila Eksekutif belum pernah melakukan pembahasan terhadap Rancangan Kerja Anggaran (RKA) SKPD akan banyak terdapat kesalahan kesalahan dalam penganggaran diantaranya nomenklatur rekening gaji.</p><p><img class=\" wp-image-3109 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1.jpg 682w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1-268x300.jpg 268w\" sizes=\"(max-width: 706px) 100vw, 706px\" width=\"706\" height=\"791\"></p><p>&nbsp;</p><p><img class=\"size-full wp-image-3110 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1.jpg 722w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1-284x300.jpg 284w\" sizes=\"(max-width: 722px) 100vw, 722px\" width=\"722\" height=\"764\"></p><p><strong>CREATED : Andy putra Martadinata, ST</strong></p></div>', '1', '2021-02-03 00:00:00', '2023-03-23 16:23:14', '2023-03-29 14:56:45'),
(19, '2. MY Hadiri Upacara Pemberangkatan 900 Pasukan TNI Ke Papua dan Papua Barat', '2-my-hadiri-upacara-pemberangkatan-900-pasukan-tni-ke-papua-dan-papua-barat', '230326103650.jpeg', '<p>bbbb</p>', '2', '2023-02-09 23:23:14', '2023-03-23 17:56:52', '2023-04-11 15:19:42'),
(21, '3. RAPAT KOORDINASI BADAN LAYANAN UMUM DAERAH (BLUD) DALAM PENGGUNAAN APLIKASI SIPD BLUD DI LINGKUNGAN PEMERINTAH PROVINSI SUMATERA SELATAN', '3-rapat-koordinasi-badan-layanan-umum-daerah-blud-dalam-penggunaan-aplikasi-sipd-blud-di-lingkungan-pemerintah-provinsi-sumatera-selatan', '230326115849.jpg', '<p>Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan melalui Bidang Akuntansi dan Pelaporan Keuangan Daerah melakukan rapat bersama&nbsp; Badan Layanan Umum Daerah (BLUD) di Lingkungan Provinsi Sumatera Selatan membahas permasalahan yang dihadapi dalam pengelolaan Badan Layanan Umum Daerah (BLUD) di Lingkungan Provinsi Sumatera Selatan dengan menggunakan aplikasi e-Blud.</p><p>Rapat dipimpin oleh Ibu Anita Mariani, SE, MM, Ak, CA selaku Kabid Akuntansi dan Pelaporan Keuangan Daerah BPKAD Prov. Sumsel yang didampingi oleh Bapak Riyatno, SE, Ak selaku Kasubbid Akuntansi III.</p><p><img class=\"alignnone size-full wp-image-3116\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1.jpg 1600w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-400x300.jpg 400w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" width=\"1600\" height=\"1200\"></p><p><img class=\"wp-image-3117 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2.jpg 710w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2-300x245.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2-367x300.jpg 367w\" sizes=\"(max-width: 710px) 100vw, 710px\" width=\"710\" height=\"580\"></p><p><img class=\"wp-image-3118 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3.jpg 690w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3-300x252.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3-357x300.jpg 357w\" sizes=\"(max-width: 722px) 100vw, 722px\" width=\"722\" height=\"607\"></p><p>Beberapa hal &nbsp;kendala yang dibahas dalam pertemuan tersebut, antara lain :</p><ol><li>Mencari solusi terhadap kendala penerapan Aplikasi e-BLUD.</li><li>Berbagi pengetahuan antar BLUD yang telah menyelesaikan permasalahan secara mandiri.</li></ol><p>Menentukan langkah kedepan untuk kelancaran Pengelolaan Keuangan BLUD dengan menggunakan aplikasi e-BLUD.</p>', '2', '2023-03-26 23:58:49', '2023-03-23 18:22:59', '2023-04-11 15:19:12'),
(23, '5. RAPAT PEMBAHASAN KESIAPAN PEMERINTAH PROVINSI SUMATERA SELATAN DALAM MELAKSANAKAN LIKUIDASI SERTA PERSYARATAN LIKUIDASI', 'rapat-pembahasan-kesiapan-pemerintah-provinsi-sumatera-selatan-dalam-melaksanakan-likuidasi-serta-persyaratan-likuidasi-1', '230326115652.jpg', '<p>Hari Selasa, tanggal 17 Januari 2023 Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan bersama Tim Likuidator PD. Industri Grafika Meru melaksanakan rapat koordinasi terkait kesiapan Pemerintah Provinsi Sumatera Selatan dalam melaksanakan Likuidasi serta persyaratan Likuidasi bertempat di ruang rapat BPKAD Prov. Sumsel.</p><p>Rapat ini dipimpin oleh Bapak Yossi Hervandi, SE, MM selaku Sekretaris Badan dan dihadiri oleh Pejabat Esselon III dan Pejabat Fungsional di lingkungan BPKAD, Tim Likuidator PD. Industri Grafika Meru, Inspektorat Daerah Prov. Sumsel dan Biro Perekonomian Setda Provinsi Sumatera Selatan.</p><p><img class=\"alignnone size-full wp-image-3063\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1.jpg 1504w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1-400x300.jpg 400w\" sizes=\"(max-width: 1504px) 100vw, 1504px\" width=\"1504\" height=\"1128\"></p><p>Pemerintah Provinsi Sumatera Selatan melalui BPKAD meminta Tim Likuidator PD. Industri Grafika Meru untuk membuat laporan secara Komprehensif sebagai laporan kepada Bapak Gubernur Prov. Sumatera Selatan, dan terhadap seluruh kewajiban yang harus dipenuhi untuk proses likudasi PD. Industri Grafika Meru memberikan sisa uang pesangon dan gaji yang tertunda sebesar 60 % yaitu Rp. 333.128.9364,00 untuk 21 karyawan serta pajak per 30 Desember 2009 sebesar Rp. 23.177.842,00 akan dipastikan (verifikasi kembali) oleh Tim Likuidator.</p><p><img class=\" wp-image-3064 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-1.jpg 704w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-1-300x213.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-1-400x284.jpg 400w\" sizes=\"(max-width: 745px) 100vw, 745px\" width=\"745\" height=\"529\"></p><p><img class=\"size-full wp-image-3065 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3.jpg 750w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-300x200.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-400x267.jpg 400w\" sizes=\"(max-width: 750px) 100vw, 750px\" width=\"750\" height=\"501\"></p><p><img class=\"alignnone size-full wp-image-3066\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4.jpg 1504w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-400x300.jpg 400w\" sizes=\"(max-width: 1504px) 100vw, 1504px\" width=\"1504\" height=\"1128\"></p><p>Hutang PD. Industri Grafika Meru pada Bank Sumsel Babel yang jatuh tempo per tanggal 23 maret 2013 sebesar Rp. 839.835.568,00 akan di verifikasi kembali oleh Tim Likuidator dan total di pengadilan untuk di validasi oleh Tim Likuidator akan diumumkan di media merupakan hak dan kewajiban PD. Industri Grafika Meru.</p><p><img class=\"alignnone size-full wp-image-3067\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1.jpg 875w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1-300x214.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1-768x549.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1-400x286.jpg 400w\" sizes=\"(max-width: 875px) 100vw, 875px\" width=\"875\" height=\"625\"></p><p>Tim Likuidator PD. Industri Grafika Meru meminta agar dibentuk Tim Hukum Pendamping di Pengadilan guna mem<i>follow up</i> proses likuidasi di luar kapasitas Tim Likuidator.</p>', '2', '2023-03-26 23:56:52', '2023-03-26 15:48:08', '2023-04-11 15:19:24'),
(24, '6. SOSIALISASI APLIKASI FMIS (FINANCIAL MANAGEMENT INFORMATION SYSTEM) PADA BADAN PENGELOLA KEUANGAN DAN ASET DAERAH PROVINSI SUMATERA SELATAN', 'sosialisasi-aplikasi-fmis-financial-management-information-system-pada-badan-pengelola-keuangan-dan-aset-daerah-provinsi-sumatera-selatan-1', '230326115554.jpg', '<div class=\"entry-content\"><p>Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan berkolaborasi dengan Badan Pengawasan Keuangan dan Pembangunan mengadakan Sosialisasi FMIS<i> (FINANCIAL MANAGEMENT INFORMATION SYSTEM)</i>.</p><p>Aplikasi FMIS merupakan&nbsp;aplikasi berbasis Web yang dikembangkan oleh BPKP yang memfasilitasi pengelolaan keuangan daerah mulai dari perencanaan sampai dengan pelaporan dan akuntabilitas kinerja.</p><p><img class=\"alignnone size-full wp-image-3050\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1.jpg 1600w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/1-400x300.jpg 400w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" width=\"1600\" height=\"1200\"></p><p>Acara Sosialisasi ini berlangsung selama 5 hari dari tanggal 9 s.d. 13 Januari 2023 bertempat di aula Dinas Perhubungan Provinsi Sumatera Selatan dan dibuka langsung oleh Bapak Yossi Hervandi, SE, MM selaku Sekretaris pada Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan dan sebagai Narasumber dari Badan Pengawasan Keuangan dan Pembangunan Perwakilan Bapak Isbandi, Ak yang didampingi oleh Bapak L. Nauli Harahap, SE Bapak Iradatul Kusalendra, S.Ak, dan Ibu Anastasia Pratiwi, SE, M.Si.</p><p><img class=\"alignnone size-full wp-image-3051\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2.jpg 1504w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/2-400x300.jpg 400w\" sizes=\"(max-width: 1504px) 100vw, 1504px\" width=\"1504\" height=\"1128\"></p><p>Dasar Hukum Pengembangan FMIS :</p><ol><li>Peraturan Pemerintah Nomor 12 Tahun 2019 tentang Pengelolaan Keuangan Daerah.</li><li>Peraturan Menteri Dalam Negeri Nomor 90 tahun 2019 tentang Klasifikasi, Kodefikas dan Nomenklatur Perencanaan Pembangunan dan Keuangan Daerah.</li><li>Keputusan Menteri Dalam Negeri Nomor 050-5889 Tahun 2021 tentang Hasil Verifikasi, Validasi dan Inventarisasi Pemuktahiran Klasifikasi, Kodefikasi dan Nomenklatur Perencanaan Pembangunan dan Keuangan Daerah.</li><li>Peraturan Menteri Dalam Negeri nomor 77 tahun 2020 tentang Pedoman Teknis &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pengelolaan Keuangan Daerah.</li><li>Peraturan Menteri Dalam Negeri Nomor 24 Tahun 2020 tentang Pengelolaan Dana Bantuan Operasional Sekolah pada Pemerintah Daerah.</li><li>Peraturan Menteri Dalam Negeri Nomor 28 Tahun 2021 tentang Pencatatan Pengesahan Dana Kapitasi Jaminan Kesehatan Nasional pada Fasilitas Kesehatan Tingkat Pertama Milik Pemerintah Daerah.</li><li>Peraturan Menteri Dalam Negeri Nomor 79 Tahun 2018 tentang Badan Layanan Umum Daerah.</li></ol><p>Sosialisasi FMIS diikuti oleh OPD di lingkungan Pemerintah Provinsi Sumatera Selatan yang dilaksanakan sesuai dengan jadwal yang telah ditentukan, dengan peserta dari bagian Perencanaan dan Pelaporan, Keuangan, Bendahara Pengeluaran, dan Operator Komputer. Materi Sosialisasi untuk sesi pertama adalah mengenai Modul Perencanaan dan Penganggaran dan sesi kedua mengenai modul Penatausahaan.</p><p>Berikut alur aplikasi FMIS dalam materi sosialisasi :</p><p><img class=\"alignnone size-full wp-image-3052\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3.png\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3.png 1366w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-300x162.png 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-768x415.png 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-1024x553.png 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/3-400x216.png 400w\" sizes=\"(max-width: 1366px) 100vw, 1366px\" width=\"1366\" height=\"738\"></p><p><img class=\"alignnone size-full wp-image-3053\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4.png\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4.png 1366w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-300x169.png 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-768x432.png 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-1024x576.png 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/4-400x225.png 400w\" sizes=\"(max-width: 1366px) 100vw, 1366px\" width=\"1366\" height=\"768\"></p><p><img class=\"alignnone size-full wp-image-3054\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5.jpg 1600w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/5-400x300.jpg 400w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" width=\"1600\" height=\"1200\"></p><p>Peserta Sosialisasi diberi pengetahuan terkait tata cara <i>Management User,&nbsp;</i>membuat struktur Unit Organisasi, membuat Struktur SSH, Perencanaan Lima Tahunan Pemda dan OPD, Penganggaran Pemda dan Penganggaran OPD hingga Penatausahaan Keuangan Daerah.</p><p>Tujuan aplikasi ini adalah agar Pemerintah Provinsi Sumatera Selatan dapat melakukan penatausahaan keuangan daerah yang baik, dimana aplikasi ini menggantikan SIMDA Keuangan yang sebelumnya pernah digunakan. Selain itu juga aplikasi ini juga berguna untuk kepentingan pengawasan (audit, reviu, monitoring, evaluasi dan pendampingan), Aparat Pengawasan Intern Pemerintah (APIP).</p><p><img class=\"alignnone size-full wp-image-3055\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6.jpg 1600w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/01/6-400x300.jpg 400w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" width=\"1600\" height=\"1200\"></p><p><strong>CREATED : Andy putra Martadinata, ST</strong></p></div>', '2', '2023-03-26 23:55:54', '2023-03-26 15:56:34', '2023-04-11 15:19:30'),
(25, '7. KUNJUNGAN KERJA DPRD KABUPATEN BANGKA SELATAN TERKAIT PENYESUAIAN APBD TA. 2023 PADA BADAN PENGELOLA KEUANGAN DAN ASET DAERAH PROVINSI SUMATERA SELATAN 1', '7-kunjungan-kerja-dprd-kabupaten-bangka-selatan-terkait-penyesuaian-apbd-ta-2023-pada-badan-pengelola-keuangan-dan-aset-daerah-provinsi-sumatera-selatan-1', '230326115421.jpg', '<div class=\"entry-content\"><p>Pada hari Senin, 20 Februari 2023 DPRD&nbsp; Kabupaten Bangka Selatan melakukan kunjungan kerja di Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan terkait “ Penyesuaian terhadap PMK&nbsp; No. 212/PMK.07/2022 tahun 2022 tentang Indikator Tingkat Kinerja Daerah dan Ketentuan Umum Bagian Dana Alokasi Umum yang ditentukan Penggunaanya pada APBD Tahun Anggaran 2023.</p><p>Kegiatan Kunjungan Kerja Tim DPRD Kabupaten Bangka Selatan dipimpin oleh Bapak&nbsp; Abu Huairi, SE diterima langsung oleh Bapak H. Akhmad Mukhlis, SE, M.Si selaku Kepala BPKAD Prov. Sumsel yang didampingi oleh Bapak Bobby Novian, SE. M.Si selaku Kepala Bidang Anggaran Pada BPKAD Prov. Sumsel.</p><p><img class=\"wp-image-3108 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1.jpg 566w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/1-1-400x300.jpg 400w\" sizes=\"(max-width: 769px) 100vw, 769px\" width=\"769\" height=\"576\"></p><p>Ada beberapa permasalahan yang dipertanyakan oleh Tim Banggar DPRD Kabupaten Bangka Selatan yang direspon oleh Kepala BPKAD Prov. Sumsel antara lain yaitu mengenai apabila Eksekutif belum pernah melakukan pembahasan terhadap Rancangan Kerja Anggaran (RKA) SKPD akan banyak terdapat kesalahan kesalahan dalam penganggaran diantaranya nomenklatur rekening gaji.</p><p><img class=\" wp-image-3109 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1.jpg 682w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/2-1-268x300.jpg 268w\" sizes=\"(max-width: 706px) 100vw, 706px\" width=\"706\" height=\"791\"></p><p>&nbsp;</p><p><img class=\"size-full wp-image-3110 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1.jpg 722w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/02/3-1-284x300.jpg 284w\" sizes=\"(max-width: 722px) 100vw, 722px\" width=\"722\" height=\"764\"></p><p><strong>CREATED : Andy putra Martadinata, ST</strong></p></div>', '1', '2021-02-03 00:00:00', '2023-03-23 16:23:14', '2023-03-29 14:57:11'),
(26, '8. MY Hadiri Upacara Pemberangkatan 900 Pasukan TNI Ke Papua dan Papua Barat 1 dady', 'my-hadiri-upacara-pemberangkatan-900-pasukan-tni-ke-papua-dan-papua-barat-1', '230326103650.jpeg', '<p>bbbb</p>', '2', '2023-02-09 23:23:14', '2023-03-23 17:56:52', '2023-04-11 15:19:48'),
(27, '9. RAPAT KOORDINASI BADAN LAYANAN UMUM DAERAH (BLUD) DALAM PENGGUNAAN APLIKASI SIPD BLUD DI LINGKUNGAN PEMERINTAH PROVINSI SUMATERA SELATAN 1', '9-rapat-koordinasi-badan-layanan-umum-daerah-blud-dalam-penggunaan-aplikasi-sipd-blud-di-lingkungan-pemerintah-provinsi-sumatera-selatan-1', '230326115849.jpg', '<p>Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan melalui Bidang Akuntansi dan Pelaporan Keuangan Daerah melakukan rapat bersama&nbsp; Badan Layanan Umum Daerah (BLUD) di Lingkungan Provinsi Sumatera Selatan membahas permasalahan yang dihadapi dalam pengelolaan Badan Layanan Umum Daerah (BLUD) di Lingkungan Provinsi Sumatera Selatan dengan menggunakan aplikasi e-Blud.</p><p>Rapat dipimpin oleh Ibu Anita Mariani, SE, MM, Ak, CA selaku Kabid Akuntansi dan Pelaporan Keuangan Daerah BPKAD Prov. Sumsel yang didampingi oleh Bapak Riyatno, SE, Ak selaku Kasubbid Akuntansi III.</p><p><img class=\"alignnone size-full wp-image-3116\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1.jpg 1600w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-300x225.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-768x576.jpg 768w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-1024x768.jpg 1024w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/1-400x300.jpg 400w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" width=\"1600\" height=\"1200\"></p><p><img class=\"wp-image-3117 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2.jpg 710w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2-300x245.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/2-367x300.jpg 367w\" sizes=\"(max-width: 710px) 100vw, 710px\" width=\"710\" height=\"580\"></p><p><img class=\"wp-image-3118 aligncenter\" src=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3.jpg\" alt=\"\" srcset=\"http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3.jpg 690w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3-300x252.jpg 300w, http://bpkad.sumselprov.go.id/wp-content/uploads/2023/03/3-357x300.jpg 357w\" sizes=\"(max-width: 722px) 100vw, 722px\" width=\"722\" height=\"607\"></p><p>Beberapa hal &nbsp;kendala yang dibahas dalam pertemuan tersebut, antara lain :</p><ol><li>Mencari solusi terhadap kendala penerapan Aplikasi e-BLUD.</li><li>Berbagi pengetahuan antar BLUD yang telah menyelesaikan permasalahan secara mandiri.</li></ol><p>Menentukan langkah kedepan untuk kelancaran Pengelolaan Keuangan BLUD dengan menggunakan aplikasi e-BLUD.</p>', '2', '2023-03-26 23:58:49', '2023-03-23 18:22:59', '2023-04-11 15:19:17');
INSERT INTO `ta_post` (`post_kd`, `post_title`, `slug_title`, `post_thumbnail`, `post_content`, `post_status`, `tgl_terbit`, `created_at`, `updated_at`) VALUES
(28, 'wawan WORKSHOP PENGELOLAAN BLUD DAN PENGGUNAAN APLIKASI E-BLUD PADA BLUD DI LINGKUNGAN PEMERINTAH PROVINSI SUMATERA SELATAN 1', 'wawan-workshop-pengelolaan-blud-dan-penggunaan-aplikasi-e-blud-pada-blud-di-lingkungan-pemerintah-provinsi-sumatera-selatan-1-1', '230326115737.jpg', '<p>Badan Pengelola Keuangan dan Aset Daerah Provinsi Sumatera Selatan melalui Bidang Akuntansi dan Pelaporan Keuangan Daerah melaksanakan Workshop bersama Badan Layanan Umum Daerah Direktorat BUMD, BLUD dan BMD Direktorat Jenderal Bina Keuangan Daerah Kementrian Dalam Negeri Republik Indonesia.</p><figure class=\"image image_resized\"><img src=\"data:image/jpeg;base64,\"></figure><figure class=\"image\"><img src=\"data:image/jpeg;base64,\"></figure><p>Workshop ini berlangsung selama 3 (tiga) hari dari tanggal 25 s.d 27 Januari 2023,&nbsp; dimana dihari pertama berlangsung diruang Rapat utama kantor BPKAD Prov. Sumsel dan dibuka langsung oleh Bapak Yossi Hervandi, SE, MM selaku Sekretaris Badan yang di dampingi Ibu Anita Mariani, SE,MM,Ak,CA, selaku Kepala Bidang Akuntansi dan Pelaporan Keuangan Daerah Provinsi. Sumatera Selatan.</p><p>Direktorat Badan Usaha Milik Daerah (BUMD), Badan Layanan Umum Daerah (BLUD) dan Barang Milik Daerah (BMD)&nbsp;sebagaimana dimaksud, mempunyai tugas melaksanakan sebagian tugas Direktorat Jenderal Bina Keuangan Daerah di bidang Pengelolaan BUMD, Lembaga Keuangan Daerah, Investasi Daerah, BLUD dan BMD.</p><p>Berdasarkan Pasal 50 s.d 57 Permendagri 79/2018 terdapat 3 (tiga) bagian pos akun besar yaitu Pendapatan BLUD, Belanja BLUD serta Pembiayaan BLUD.</p><p>Narasumber pada kegiatan Workshop ini dari Direktorat BUMD, BLUD, BMD Direktorat Keuangan Daerah Kementrian Republik Indonesia Bapak R.Wisnu Saputro,SE, M.A.P selaku Kasubdit&nbsp; dan Bapak Dr. H. Budi Santoso, M.Si selaku Direktur BLUD Direktorat BUMD , BLUD dan BMD Direktorat Jendral Keuangan Daerah secara zoom meeting.</p><figure class=\"image\"><img src=\"data:image/jpeg;base64,\"></figure><p>&nbsp;</p><figure class=\"image\"><img class=\"image_resized\" src=\"data:image/jpeg;base64,\"></figure><p>&nbsp;</p><p>Di hari kedua Kegiatan Workshop ini berlangsung di ruang rapat utama Dinas Perhubungan Provinsi Sumatera Selatan yang dipimpin oleh Bapak Riyatno, SE, M.Ak selaku Kasubbid Akuntansi III dan sebagai Narasumber Bapak Anggi Ginanjar, S.Kom serta Bapak Airlangga Satriojati, SE dari Lembaga Penelitian dan Pengembangan Sosial Universitas Indonesia.</p><p>BLUD merupakan bagian dari perangkat daerah, dengan status hukum tidak terpisah dari pemerintah daerah. Berbeda dengan SKPD pada umumnya, pola pengelolaan keuangan BLUD memberikan fleksibilitas berupa keleluasaan untuk menerapkan praktik-praktik bisnis yang sehat untuk meningkatkan pelayanan kepada masyarakat, seperti pengecualian dari ketentuan pengelolaan keuangan daerah pada umumnya. Sebuah satuan kerja atau unit kerja dapat ditingkatkan statusnya sebagai BLUD sepanjang memenuhi ketentuan peraturan yang berlaku.</p><p>Materi Workshop&nbsp; yang disampaikan dihari kedua adalah mengenai Saldo Awal BLUD, Bendahara Penerimaan BLUD, Bendahara Pengeluaran BLUD.</p><figure class=\"image image_resized\" style=\"width:75%;\"><img src=\"data:image/jpeg;base64,\"></figure><p>Dengan adanya Workshop ini diharapkan dapat menambah wawasan&nbsp; peserta dalam meningkatkan layanan kinerja layanan BLUD.</p>', '2', '2023-03-27 14:55:14', '2023-03-26 15:44:14', '2023-04-11 18:34:41');
